.user-card {
  box-sizing: border-box;
  padding: 15px;
  background-color: #fff;
  box-shadow: 2px 2px 5px rgba(0, 0, 0, 0.3);
  width: 400px;
  min-height: 160px;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  transition: all 0.3s;
  &:hover {
    transform: scale(1.05);
  }
  &__top {
    display: flex;
  }
  &__bottom {
    display: flex;
    justify-content: flex-end;
    button {
      border: none;
      background: $accent;
      color: #fff;
      outline: none;
      padding: 5px 10px;
      text-align: center;
      cursor: pointer;
      margin-left: 10px;
      font-size: 16px;
      transition: all 0.2s;

      &:first-child {
        background-color: #fff;
        color: #333;
      }

      &:hover {
        box-shadow: 1px 1px 3px rgba($color: #000000, $alpha: 0.2);
      }
    }
  }
}
.user {
  &__name {
    margin-bottom: 5px;
  }
  &__avatar {
    width: 80px;
    height: 80px;
    background-color: #2c303a;
    position: relative;
    border-radius: 50%;
    box-sizing: border-box;
    text-align: center;
    padding: 10px;
    margin-right: 15px;
    margin-bottom: 15px;
    img {
      height: 100%;
    }
  }
  &__name {
    font-size: 24px;
  }
}

